import logo from './logo.svg';
import './App.css';

import AddProductForm from './components/AddProductForm';
import ProductTable from './components/ProductTable';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          <AddProductForm/>
          {/* <ProductTable/> */}
        </a>
      </header>
    </div>
  );
}

export default App;
